import Unit from "../strategy/classes/unit/Unit";
import { generateQueue } from "../Logic/Generatequeue";

import "./LeftPart.css";
interface LeftPartProps {
  units: Array<Unit>;
}
export const LeftPart: FunctionComponent<LeftPartProps> = props => {
  console.log("start");
  generateQueue(props.units);
  console.log("end");

  const renderCell = () => {
    const unitsArrayUI = props.units.map((unit, index) => {
      return (
        <div className="cell" key={index}>
          <div className="cell__unit-info">
            <img
              onClick={() => {}}
              className="cell__unit-info__image"
              src={unit._imgPath}
              alt="img"
            />
          </div>
          <div className="cell__HP">
            <progress
              className="cell__HP__bar"
              value={uni}
              max={unit._HP}
            ></progress>
          </div>
        </div>
      );
    });
    return unitsArrayUI;
  };

  return <div className="left-part">{renderCell()}</div>;
};
